    18,nt"tags": [],nt"title": "Dissolved inorganic carbon, pH, alkalinity,
    temperature, salinity and other variables collected from discrete sample and profile
    observations using CTD, bottle and other instruments from AKADEMIK ALEKSANDR NESMEYANOV
    in the North Pacific Ocean and Sea of Okhotsk from 1993-08-08 to 1993-09-21 (NODC
    Accession 0115169)",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-05-10T00:06:23.082527",nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-froe0edf",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0115169 includes discrete
    sample and profile data collected from AKADEMIK ALEKSANDR NESMEYANOV in the North
    Pacific Ocean and Sea of Okhotsk from 1993-08-08 to 1993-09-21. These data include
    CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13,
    DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, Delta Oxygen-18, HYDROSTATIC
    PRESSURE, NITRATE, NITRITE, Potential temperature (theta), SALINITY, TOTAL ALKALINITY
    (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH, phosphate and silicate.
    The instruments used to collect these data include CTD and bottle.nnThese data were
    collected by C. S. Wong of Department of Fisheries and Oceans; Institute of Ocean
    Sciences as part of the WOCE_P01W data set. CDIAC associated the following cruise
    ID(s) with this data set: WOCE_P01WnnThe World Ocean Circulation Experiment (WOCE)
    was a major component of the World Climate Research Program with the overall goal
    of better understanding the ocean's role in climate and climatic changes resulting
    from both natural and anthropogenic causes. The CO2 survey took advantage of the
    sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
    this period between 1990 and 1998. The final collection covers approximately 23,000
